public class ArrayWorld {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] namesOfSomePeople = new String[10];
		
		// Adding names below
		namesOfSomePeople[0] = "Mr A";
		namesOfSomePeople[1] = "Mr B";
		namesOfSomePeople[2] = "Mr C";
		namesOfSomePeople[3] = "Mr D";
		namesOfSomePeople[4] = "Mr E";
		
		// Read the Array
		for(int index=0;index<namesOfSomePeople.length;index++) {
			System.out.println(namesOfSomePeople[index]);
		}

	}

}
